import React from "react";
import "./Sidebar.css";

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div>
        <span>
          <h4>My Profile</h4>{" "}
        </span>
        <img src="https://via.placeholder.com/60" />
      </div>
      <div>
        <ul>
          <li>currently reading</li>
          <li>read later</li>
          <li>Book shelf readed</li>
        </ul>
      </div>
    </div>
  );
};

export default Sidebar;
